const Leaderboard = ({ topScores }) => {


  return (
    <div className="leaderboard">
      <table className="table">
          <thead>
          <tr>
            <td>Username</td><td>time</td>
          </tr>
          </thead>
          {topScores.map(score => 
          <tr key={score.id}>
            <td>{score.username}</td> <td>{score.time}</td>
          </tr>
          )}
      </table>
    </div>
  )
}

export default Leaderboard
